\boxed{\frac{1}{2}} 

Per risolvere il problema si osserva che i due lanci determinano, in maniera indipendente, una colonna (tramite il resto della divisione per 4 che può essere 1, 2 o 3) e una riga (tramite il resto della divisione per 5 che può essere 1, 2, 3 o 4). Ciò dà un totale di 3×4 = 12 caselle della scacchiera, e ciascuna casella è equiprobabile.

In una scacchiera in cui le caselle sono colorate in modo alterno (con esattamente metà ombreggiate e metà chiare) il numero di caselle ombreggiate è 6. Quindi la probabilità che la pedina cada su una casella ombreggiata è 6/12, cioè 1/2.
